import { Grid, Paper } from '@material-ui/core';
import React from 'react';


const SignLog = () => {

    return (
        <div>
            <Grid >
                <Paper elevation = {11} style={{backgroundColor:"#483D8B",padding:"40px", height:"70vh",minHeight:"20vh", width: "30vw", margin: "30px auto"}} >
                    <p>Hi</p>
                </Paper>
            </Grid>
        </div>
    )
}

export default SignLog;
